<style>
    body { margin: 0; overflow: hidden; background-color: #000000; font-family: 'Rowdies', 'Noto Sans SC', sans-serif; user-select: none; }
    canvas { display: block; }
    
    /* UI å®¹å™¨ */
    #ui-layer { position: absolute; top: 0; left: 0; width: 100%; height: 100%; pointer-events: none; z-index: 10; display: flex; flex-direction: column; justify-content: space-between; }
    
    /* é¡¶éƒ¨æ ‡é¢˜æ  (åˆå§‹ä½ç½®) */
    #top-bar { 
        text-align: center; margin-top: 20px; opacity: 0; animation: fadeIn 1s forwards 1s; 
        transition: all 0.8s cubic-bezier(0.68, -0.55, 0.27, 1.55); /* å¼¹æ€§è¿‡æ¸¡åŠ¨ç”» */
        position: relative;
        width: 100%;
    }
    
    h1 { margin: 0; color: #fff; font-size: 2rem; letter-spacing: 2px; text-shadow: 0 0 20px #ff00de; transition: all 0.5s; }
    
    /* [CONFIG] ğŸ† æœ€ç»ˆå½¢æ€ï¼šå±å¹•æ­£ä¸­é—´å¤§å­— */
    .center-hero {
        position: fixed !important;
        top: 50% !important;
        left: 50% !important;
        transform: translate(-50%, -50%) !important;
        margin: 0 !important;
        width: 100%;
        z-index: 20;
    }
    
    /* é—ªçƒç‰¹æ•ˆ */
    .celebrate-text { 
        font-size: 4rem !important; /* å­—ä½“è¶…å¤§ */
        color: #ffffff !important; 
        text-shadow: 0 0 15px #fff, 0 0 30px #eb92df, 0 0 60px #54e4e4 !important; 
        animation: pulse 0.5s infinite alternate; 
        line-height: 1.2;
    }

    #bottom-bar { text-align: center; margin-bottom: 30px; }
    .hint-box { display: inline-block; background: rgba(0, 0, 0, 0.6); border: 1px solid rgba(255,255,255,0.3); padding: 10px 20px; border-radius: 50px; color: #fff; font-size: 14px; backdrop-filter: blur(5px); }
    .highlight { color: #00ffff; font-weight: bold; }
    .pink { color: #ff00de; font-weight: bold; }
    
    #cam-preview { position: absolute; top: 20px; right: 20px; width: 160px; height: 120px; border-radius: 12px; border: 2px solid rgba(255,255,255,0.2); background: #000; overflow: hidden; opacity: 0.8; transition: opacity 0.3s; }
    video { width: 100%; height: 100%; object-fit: cover; transform: scaleX(-1); }
    #status-label { position: absolute; bottom: 0; width: 100%; background: rgba(255, 0, 204, 0.8); color: #fff; font-size: 10px; text-align: center; padding: 2px 0; }
    #overlay { position: absolute; top: 0; left: 0; width: 100%; height: 100%; background: rgba(2, 0, 5, 0.95); z-index: 100; pointer-events: auto; display: flex; flex-direction: column; justify-content: center; align-items: center; }
    
    button { padding: 15px 50px; font-size: 20px; font-weight: bold; background: linear-gradient(45deg, #ff00cc, #3333ff); color: white; border: none; border-radius: 50px; cursor: pointer; box-shadow: 0 0 30px rgba(255, 0, 204, 0.6); transition: transform 0.2s; font-family: 'Rowdies', sans-serif; letter-spacing: 1px; }
    button:hover { transform: scale(1.05); background: linear-gradient(45deg, #ff33dd, #5555ff); }
    
    @keyframes fadeIn { to { opacity: 1; } }
    @keyframes pulse { from { text-shadow: 0 0 20px #fff, 0 0 40px #ff00de; transform: scale(1); } to { text-shadow: 0 0 50px #fff, 0 0 80px #00ffff; transform: scale(1.05); } }
    .hidden { opacity: 0; pointer-events: none; transition: opacity 0.5s; }
</style>

        composer.addPass(bloom);

        // Solid Circle Texture
        const cvs = document.createElement('canvas'); cvs.width=32; cvs.height=32;
        const ctx = cvs.getContext('2d');
        ctx.fillStyle = '#ffffff'; 
        ctx.beginPath(); ctx.arc(16, 16, 14, 0, Math.PI * 2); ctx.fill();
        tex = new THREE.CanvasTexture(cvs);

        const particleShader = {
            vertex: `
                uniform float uTime; uniform float uScatter; 
                attribute vec3 aTarget; attribute vec3 aRandom; attribute float aSize; attribute vec3 aColor; 
                varying vec3 vColor;
                void main() { 
                    vColor = aColor; 
                    if (aSize < 0.01) { gl_Position = vec4(2.0, 2.0, 2.0, 1.0); gl_PointSize = 0.0; return; }
                    vec3 pos = mix(aTarget, aRandom, uScatter);
                    if(uScatter > 0.5) { 
                        pos.x += sin(uTime * 3.0 + aRandom.y) * 2.0 * uScatter;
                        pos.y += cos(uTime * 2.5 + aRandom.x) * 2.0 * uScatter; 
                        pos.z += sin(uTime * 4.0 + aRandom.z) * 2.0 * uScatter; 
                    } else { 
                        pos += sin(uTime * 5.0 + position.x) * 0.05; 
                    }
                    vec4 mv = modelViewMatrix * vec4(pos, 1.0); 
                    gl_Position = projectionMatrix * mv;
                    
                    // [CONFIG] ğŸ”¢ ç²’å­å¤§å°å€æ•° (180.0) -> æ”¹å¤§è¿™ä¸ªæ•°å€¼ç²’å­å°±ä¼šå˜å¤§
                    float sizeMultiplier = 120.0; 
                    
                    float pointSize = aSize * (1.0 + uScatter * 1.5) * (sizeMultiplier / max(0.0001, -mv.z));
                    gl_PointSize = clamp(pointSize, 0.0, 50.0);
                }`,
            fragment: `
                uniform sampler2D uTex; varying vec3 vColor; 
                void main() { 
                    vec4 t = texture2D(uTex, gl_PointCoord); 
                    if(t.a < 0.5) discard; 
                    // [CONFIG] ğŸ’¡ è°ƒæ•´æ–‡å­—äº®åº¦ï¼švColor * æ•°å€¼
                    gl_FragColor = vec4(vColor * 0.75, 1.0); 
                }`
        };

        function initParticles() {
            const geo = new THREE.BufferGeometry();
            const attrs = { pos:[], target:[], random:[], col:[], size:[] };
            
            for(let i=0; i<MAX_POINTS; i++) {
                const r = 40 + Math.random()*40, th = Math.random()*Math.PI*2, ph = Math.acos(2*Math.random()-1);
                const rx = r*Math.sin(ph)*Math.cos(th), ry = r*Math.sin(ph)*Math.sin(th), rz = r*Math.cos(ph);
                attrs.pos.push(0,0,0); attrs.target.push(rx,ry,rz); attrs.random.push(rx,ry,rz);
                attrs.col.push(1,1,1); attrs.size.push(0);
            }
            geo.setAttribute('position', new THREE.BufferAttribute(new Float32Array(attrs.pos),3));
            geo.setAttribute('aTarget', new THREE.BufferAttribute(new Float32Array(attrs.target),3));
            geo.setAttribute('aRandom', new THREE.BufferAttribute(new Float32Array(attrs.random),3));
            geo.setAttribute('aColor', new THREE.BufferAttribute(new Float32Array(attrs.col),3));
            geo.setAttribute('aSize', new THREE.BufferAttribute(new Float32Array(attrs.size),1));

            const mat = new THREE.ShaderMaterial({ 
                uniforms: { uTime: { value: 0 }, uScatter: { value: 1.0 }, uTex: { value: tex } }, 
                vertexShader: particleShader.vertex, fragmentShader: particleShader.fragment, 
                transparent: true, depthWrite: false, blending: THREE.AdditiveBlending 
            });

            particleMesh = new THREE.Points(geo, mat); 
            scene.add(particleMesh);
            updateGeometry(TEXT_SEQUENCE[0]);
        }

        function updateGeometry(text) {
            let pts = []; 
            const isHeart = text === "ğŸ’—";
            
            if(isHeart) { 
                const target = 10000; let attempts = 0;
                while(pts.length/3 < target && attempts < target*12) {
                    attempts++; const nx=Math.random()*3-1.5, ny=Math.random()*3-1.5;
                    if(Math.pow(nx*nx + ny*ny - 1.0, 3) - nx*nx * Math.pow(ny, 3) <= 0)
                        pts.push(nx*15, ny*15, (Math.random()-0.5)*5);
                }
            } else {
                const size=1024; const c2=document.createElement('canvas'); c2.width=c2.height=size;
                const x2=c2.getContext('2d'); x2.fillStyle='#000'; x2.fillRect(0,0,size,size);
                x2.textAlign='center'; x2.textBaseline='middle'; x2.fillStyle='#fff';
                const lines=text.split('\n'); let fs=lines.length>1?160:350; x2.font=`900 ${fs}px "Rowdies"`;
                while(lines.some(l=>x2.measureText(l).width>size*0.9)) { fs*=0.9; x2.font=`900 ${fs}px "Rowdies"`; }
                lines.forEach((l,i)=>x2.fillText(l,size/2,size/2-((lines.length-1)*fs*1.1)/2+i*fs*1.1));
                const data=x2.getImageData(0,0,size,size).data;
                for(let y=0;y<size;y+=5) for(let x=0;x<size;x+=5) if(data[(y*size+x)*4]>128) 
                    pts.push((x/size-0.5)*60, (0.5-y/size)*60, 0); 
            }

            const attrT=particleMesh.geometry.attributes.aTarget, attrR=particleMesh.geometry.attributes.aRandom, attrS=particleMesh.geometry.attributes.aSize, attrC=particleMesh.geometry.attributes.aColor;

            for(let i=0; i<MAX_POINTS; i++) {
                if(i < pts.length/3) {
                    attrT.setXYZ(i, pts[i*3], pts[i*3+1], pts[i*3+2]);
                    attrS.setX(i, isHeart?0.8+Math.random():Math.random()*0.6+0.4);
                    const r=50+Math.random()*50, th=Math.random()*Math.PI*2, ph=Math.random()*Math.PI;
                    attrR.setXYZ(i, r*Math.sin(ph)*Math.cos(th), r*Math.sin(ph)*Math.sin(th), r*Math.cos(ph));
                    const c=new THREE.Color(); 
                    if(isHeart) c.setHSL(0.95+Math.random()*0.05, 0.9, 0.6); 
                    else c.setHSL(Math.random(), 0.8, 0.6);
                    attrC.setXYZ(i, c.r, c.g, c.b);
                } else { attrS.setX(i, 0.0); attrT.setXYZ(i,0,0,0); }
            }
            attrT.needsUpdate=true; attrS.needsUpdate=true; attrR.needsUpdate=true; attrC.needsUpdate=true;
        }

        // --- Firework Spawner ---
        function spawnFireworkAtNDC(ndcX, ndcY) {
            let vec = new THREE.Vector3(ndcX, ndcY, 0.5);
            vec.unproject(camera); 
            vec.sub(camera.position).normalize();
            var distance = -camera.position.z / vec.z;
            var worldPos = new THREE.Vector3().copy(camera.position).add(vec.multiplyScalar(distance));
            
            const count = 300 + Math.floor(Math.random()*200);
            const geo = new THREE.BufferGeometry();
            const pos = new Float32Array(count*3), vel = new Float32Array(count*3), col = new Float32Array(count*3);
            
            for(let i=0;i<count;i++){
                pos[i*3]=worldPos.x; pos[i*3+1]=worldPos.y; pos[i*3+2]=worldPos.z;
                
                const spd=15+Math.random()*15, th=Math.random()*Math.PI*2, ph=Math.random()*Math.PI;
                vel[i*3]=Math.cos(th)*Math.sin(ph)*spd;
                vel[i*3+1]=Math.sin(th)*Math.sin(ph)*spd;
                vel[i*3+2]=Math.cos(ph)*spd;
                
                const c=new THREE.Color().setHSL(Math.random(), 0.9, 0.65); 
                c.multiplyScalar(1.8); // æ•´ä½“äº®åº¦æ”¾å¤§1.8å€ï¼ˆæ•°å€¼è¶Šå¤§è¶Šäº®ï¼Œ1.5-2.0ä¹‹é—´æœ€åˆé€‚ï¼‰
                col[i*3]=c.r; col[i*3+1]=c.g; col[i*3+2]=c.b;
            }
            
            geo.setAttribute('position', new THREE.BufferAttribute(pos,3));
            geo.setAttribute('color', new THREE.BufferAttribute(col,3));
            
            // [CONFIG] ğŸ¯ çƒŸèŠ±ç²’å­å¤§å°
            const pts = new THREE.Points(geo, new THREE.PointsMaterial({ 
                size: 0.55, 
                map: tex, 
                vertexColors: true, 
                transparent: true, 
                blending: THREE.AdditiveBlending, 
                depthWrite: false 
            }));
            pts.userData = { vel, age: 0, life: 1.5 + Math.random()*0.5 }; 
            scene.add(pts);
            fireworks.push(pts);
        }

        function onAssemble() { 
            if (STATE.fireworkMode) return;
            if(!STATE.isAssembled){ 
                if(STATE.canAdvance) {
                    STATE.stepIndex=(STATE.stepIndex+1)%TEXT_SEQUENCE.length;
                    updateGeometry(TEXT_SEQUENCE[STATE.stepIndex]); 
                }
                STATE.targetScatter=0; 
                STATE.isAssembled=true; 
                STATE.canAdvance=false; 
                document.getElementById('status-label').innerText="Status: ASSEMBLED"; 
            } 
        }

        function onExplode() { 
            if (STATE.fireworkMode) return;
            if(STATE.isAssembled){ 
                STATE.targetScatter=1.0; 
                STATE.isAssembled=false; 
                STATE.canAdvance=true; 
                document.getElementById('status-label').innerText="Status: EXPLODED";
                
                if(TEXT_SEQUENCE[STATE.stepIndex]==="ğŸ’—"){ 
                    STATE.fireworkMode = true;
                    // [FEATURE] Center the Title and Change Text
                    const titleBar = document.getElementById('top-bar');
                    const title = document.getElementById('main-title');
                    
                    // Move bar to center
                    titleBar.classList.add('center-hero');
                    
                    // Change content and style
                    title.innerText = "HAPPY NEW YEAR!";
                    title.className = "celebrate-text";
                    
                    document.getElementById('hint-text').innerHTML = "âœ¨ Mode: <span class='pink'>Magic Fireworks</span> (Move hand to rotate, Open to spark)";
                } 
            } 
        }

        window.addEventListener('pointerdown', (e)=>{ STATE.useMouse=true; onAssemble(); });
        window.addEventListener('pointerup', (e)=>{ 
            if(STATE.fireworkMode) spawnFireworkAtNDC((e.clientX/window.innerWidth)*2-1, -((e.clientY/window.innerHeight)*2-1));
            else onExplode(); 
        });

        async function initAI() {
            const vision = await FilesetResolver.forVisionTasks("https://cdn.jsdelivr.net/npm/@mediapipe/tasks-vision@0.10.3/wasm");
            handLandmarker = await HandLandmarker.createFromOptions(vision, { baseOptions: { modelAssetPath: `https://storage.googleapis.com/mediapipe-models/hand_landmarker/hand_landmarker/float16/1/hand_landmarker.task`, delegate: "GPU" }, runningMode: "VIDEO", numHands: 1 });
            if(pendingStart) predict();
        }

        async function predict() {
            if(video.currentTime!==lastVideoTime){
                lastVideoTime=video.currentTime; 
                const res=handLandmarker.detectForVideo(video,performance.now());
                if(res.landmarks.length>0){
                    STATE.hasHand = true;
                    const lm=res.landmarks[0], wrist=lm[0], tips=[lm[8],lm[12],lm[16],lm[20]];
                    const avg = tips.reduce((a,t)=>a+Math.hypot(t.x-wrist.x,t.y-wrist.y),0)/4;
                    STATE.handX = lm[9].x; 
                    let currentGesture = 'none';
                    if (avg < 0.25) currentGesture = 'fist'; else if (avg > 0.40) currentGesture = 'open';

                    if (STATE.fireworkMode) {
                        if (currentGesture === 'open' && STATE.lastGesture !== 'open') spawnFireworkAtNDC((1.0 - lm[9].x - 0.5)*2, -(lm[9].y - 0.5)*2);
                    } else {
                        if (currentGesture === 'fist') onAssemble(); else if (currentGesture === 'open') onExplode();
                    }
                    STATE.lastGesture = currentGesture;
                    document.getElementById('status-label').innerText = `Hand: ${currentGesture.toUpperCase()}`;
                } else { STATE.hasHand = false; if(!STATE.useMouse) document.getElementById('status-label').innerText = "No Hand Detected"; }
            }
            requestAnimationFrame(predict);
        }

      // [é…ç½®] ç‚¹å‡»æŒ‰é’®å¼€å§‹ï¼šéšè—é®ç½© + æ’­æ”¾éŸ³ä¹
        document.getElementById('start-btn').onclick=async()=>{
            document.getElementById('overlay').classList.add('hidden');
            
            // æ’­æ”¾éŸ³ä¹
            const bgm = document.getElementById('bgm');
            if (bgm) bgm.play().catch(e => console.log("Audio play error", e));

            try { const s=await navigator.mediaDevices.getUserMedia({video:true}); video.srcObject=s; pendingStart=true; if(handLandmarker) video.onloadeddata=predict; } catch(e) { alert("Camera access denied."); }
        };

        const clock = new THREE.Clock();
        function animate() {
            requestAnimationFrame(animate);
            const dt = clock.getDelta(); const elapsed = clock.getElapsedTime();
            STATE.scatterVal += (STATE.targetScatter - STATE.scatterVal) * 0.1;

            if(particleMesh) { 
                particleMesh.material.uniforms.uTime.value = elapsed;
                particleMesh.material.uniforms.uScatter.value = STATE.scatterVal; 
                if(STATE.fireworkMode) {
                    particleMesh.material.opacity = THREE.MathUtils.lerp(particleMesh.material.opacity, 0, 0.05);
                    if(particleMesh.material.opacity < 0.05) particleMesh.visible = false;
                }
            }

            if (STATE.hasHand) {
                controls.autoRotate = false;
                const targetRot = (0.5 - STATE.handX) * 4.0; 
                particleMesh.rotation.y += (targetRot - particleMesh.rotation.y) * 0.1;
            } else { controls.autoRotate = true; controls.update(); }

            for(let i=fireworks.length-1; i>=0; i--) {
                const fw=fireworks[i]; fw.userData.age+=dt; const t=fw.userData.age/fw.userData.life;
                if(fw.userData.vel) {
                    const pA=fw.geometry.attributes.position, v=fw.userData.vel;
                    for(let j=0;j<pA.count;j++){ 
                        v[j*3+1] -= 25.0 * dt; v[j*3] *= 0.98; v[j*3+1] *= 0.98; v[j*3+2] *= 0.98;
                        pA.array[j*3]+=v[j*3]*dt; pA.array[j*3+1]+=v[j*3+1]*dt; pA.array[j*3+2]+=v[j*3+2]*dt; 
                    }
                    pA.needsUpdate=true; fw.material.opacity=Math.max(0,1-t);
                }
                if(fw.userData.age>fw.userData.life){ scene.remove(fw); fw.geometry.dispose(); fw.material.dispose(); fireworks.splice(i,1); }
            }
            composer.render();
        }

        initParticles(); initAI(); animate();
        window.onresize=()=>{ camera.aspect=window.innerWidth/window.innerHeight; camera.updateProjectionMatrix(); renderer.setSize(window.innerWidth,window.innerHeight); composer.setSize(window.innerWidth,window.innerHeight); };
    </script>
</body>
